#include "utils.c"

int main(){
	BIGNUM* pubKey = BN_new();
	BIGNUM* mod = BN_new();
	BIGNUM* BN = BN_new();
	BIGNUM* d = BN_new();

	BN_hex2bn(&pubKey, "");
	BN_hex2bn(&mod, "010001");
	BN_hex2bn(&BN, "");
    
	d = rsa_decrypt(BN, mod, pubKey);

	printBN("The result is: ", d);
	printf("\n");

    return 0;
}